import React, { Component } from 'react'
import { Input, Menu, Segment,Form } from 'semantic-ui-react'

export default class MenuExampleTabularOnTop extends Component {
  state = { activeItem: 'company' }
    content_company = "company"
    content_student = "student"
    content(){
        if(self.state.activeItem === 'company'){
            return this.content_company
        }
        else{
            return this.content_student
        }
    }

  handleItemClick = (e, { name }) => this.setState({ activeItem: name })

  render() {
    const { activeItem } = this.state

    return (
      <div>
        <Menu attached='top' tabular>
          <Menu.Item
            name='company'
            active={activeItem === 'company'}
            onClick={this.handleItemClick}
          />
          <Menu.Item
            name='student'
            active={activeItem === 'student'}
            onClick={this.handleItemClick}
          />
        </Menu>

        <Segment attached='bottom'>
          {content}
        </Segment>
      </div>
    )
  }
}
